<#
.SYNOPSIS
    Microsoft 365 Ultimate Installer
.DESCRIPTION
    Automated installation and licensing of Microsoft 365 Enterprise.
    Features:
    - Installs Microsoft 365 Enterprise (Current Channel Preview)
    - Includes Project Pro, Visio Pro, Teams, Clipchamp, Power Automate
    - Languages: En-US, Es-ES, Ja-JP, Pt-BR
    - Privacy: Maximum lockdown (Telemetry disabled)
    - Exclusions: OneDrive, OneNote, Skype, Sticky Notes (Blocked)
    - Licensing: Auto-activation for Windows (HWID) and Office (Ohook)
.PARAMETER Force
    Force clear any stuck instance mutex before running.
    Use this if you get "Another instance is already running" message.
.NOTES
    Version: 3.0.0 (Single script, hidden execution, improved cleanup)
    Author: AC Tech
#>
param(
    [switch]$Force,
    [switch]$IsHidden
)
#Requires -Version 5.1
#Requires -RunAsAdministrator
Add-Type -AssemblyName PresentationFramework, PresentationCore, WindowsBase, System.Drawing
# ============================================================================
# SELF-ELEVATION & HIDDEN EXECUTION (RELAUNCH HIDDEN, NO P/INVOKE)
# ============================================================================
# If the console is visible, relaunch the script hidden and exit the parent.
# Uses only native Start-Process (no C#/PInvoke) to minimize AV heuristics.
# RECURSION GUARD: Environment variable flag to prevent infinite relaunch
if ($env:MUI_RELAUNCHED -eq "1") {
    $IsHidden = $true
}

if (-not $IsHidden) {
    $scriptPath = $MyInvocation.MyCommand.Path
    $tempInstallerPath = Join-Path $env:TEMP "MicrosoftUltimateInstaller.ps1"

    if ([string]::IsNullOrEmpty($scriptPath)) {
        # Web/Memory execution detected. Save to Temp.
        try {
            $scriptPath = $tempInstallerPath
            $MyInvocation.MyCommand.Definition | Out-File -FilePath $scriptPath -Encoding UTF8 -Force
        }
        catch {
            Write-Host "Error staging web script: $_" -ForegroundColor Red
            exit 1
        }
    }

    try {
        $psPath = (Get-Process -Id $PID).Path
        
        # Build command that sets env var THEN runs script (env var must be set in same session)
        $forceParam = if ($Force) { " -Force" } else { "" }
        $escapedPath = $scriptPath -replace "'", "''"
        $commandString = "`$env:MUI_RELAUNCHED='1'; & '$escapedPath' -IsHidden$forceParam"
        
        # Use -Command instead of -File to allow inline env var assignment
        $argList = @(
            "-NoLogo",
            "-NoProfile",
            "-ExecutionPolicy", "Bypass",
            "-Command", $commandString
        )

        Start-Process -FilePath $psPath -ArgumentList $argList -Verb RunAs -WindowStyle Hidden
        exit
    }
    catch {
        Write-Host "Error launching process: $_" -ForegroundColor Red
        exit 1
    }
}
$ErrorActionPreference = 'Stop'
$ProgressPreference = 'SilentlyContinue'

