# ============================================================================
# CONSOLE CONTROL UTILITIES
# ============================================================================
function Disable-QuickEdit {
    try {
        $consoleType = @"
            using System;
            using System.Runtime.InteropServices;
            public class ConsoleUtils {
                [DllImport("kernel32.dll", SetLastError = true)]
                public static extern IntPtr GetStdHandle(int nStdHandle);
                [DllImport("kernel32.dll")]
                public static extern bool GetConsoleMode(IntPtr hConsoleHandle, out uint lpMode);
                [DllImport("kernel32.dll")]
                public static extern bool SetConsoleMode(IntPtr hConsoleHandle, uint dwMode);
            }
"@
        Add-Type -TypeDefinition $consoleType
        $STD_INPUT_HANDLE = -10
        $ENABLE_QUICK_EDIT_MODE = 0x0040
        $ENABLE_INSERT_MODE = 0x0020
        $handle = [ConsoleUtils]::GetStdHandle($STD_INPUT_HANDLE)
        $mode = 0
        if ([ConsoleUtils]::GetConsoleMode($handle, [ref]$mode)) {
            $mode = $mode -band (-bnot ($ENABLE_QUICK_EDIT_MODE -bor $ENABLE_INSERT_MODE))
            [void][ConsoleUtils]::SetConsoleMode($handle, $mode)
        }
    }
    catch {
        # Intentionally empty: P/Invoke may fail in non-console hosts (e.g., ISE)
        $null = $_.Exception
    }
}
