# ============================================================================
# REGISTRY BACKUP & RESTORATION
# ============================================================================
$Script:RegistryBackups = @{}
function Set-RegistryValue {
    [CmdletBinding(SupportsShouldProcess)]
    param($Path, $Name, $Value, $Type = 'String')
    try {
        # Backup the existing value if it exists
        if (Test-Path $Path) {
            $currentValue = Get-ItemProperty -Path $Path -Name $Name -ErrorAction SilentlyContinue
            if ($currentValue) {
                $Script:RegistryBackups[$Path] = @{
                    Exists = $true
                    Data   = @{ Name = $Name; Value = $currentValue.$Name; Type = $currentValue.GetType().Name }
                }
            }
            else {
                $Script:RegistryBackups[$Path] = @{ Exists = $false }
            }
        }
        else {
            $Script:RegistryBackups[$Path] = @{ Exists = $false }
        }

        # Set the new value
        Set-ItemProperty -Path $Path -Name $Name -Value $Value -Type $Type -Force -ErrorAction Stop
        Write-InstallLog "Registry value set: $Path\$Name = $Value (Type: $Type)" -Level Debug
    }
    catch {
        Write-InstallLog "Failed to set registry value $Path\$Name : $($_.Exception.Message)" -Level Debug
    }
}
function Export-RegistryBranch {
    param([Parameter(Mandatory)] [string]$Path)
    $items = @()
    try {
        $regKey = Get-Item $Path -ErrorAction SilentlyContinue
        if ($regKey) {
            $properties = $regKey.GetValueNames()
            foreach ($propName in $properties) {
                if ([string]::IsNullOrEmpty($propName)) { continue }
                $items += @{
                    Name  = $propName
                    Value = $regKey.GetValue($propName)
                    Type  = $regKey.GetValueKind($propName).ToString()
                }
            }
        }
    }
    catch {
        Write-InstallLog "Failed to export registry branch $Path : $($_.Exception.Message)" -Level Debug
    }
    return $items
}
function Restore-RegistryKey {
    param([Parameter(Mandatory)] [string]$Path)
    try {
        if ($Script:RegistryBackups[$Path]) {
            if ($Script:RegistryBackups[$Path].Exists) {
                Write-InstallLog "Restoring registry key: $Path" -Level Debug
                # REFINEMENT: Remove properties not in original backup to ensure clean restoration
                try {
                    $currentKey = Get-Item $Path -ErrorAction SilentlyContinue
                    if ($currentKey) {
                        $currentProps = $currentKey.GetValueNames()
                        $backupProps = $Script:RegistryBackups[$Path].Data | Select-Object -ExpandProperty Name
                        foreach ($prop in $currentProps) {
                            if ($prop -and $backupProps -notcontains $prop) {
                                Remove-ItemProperty -Path $Path -Name $prop -Force -ErrorAction SilentlyContinue
                            }
                        }
                    }
                }
                catch { Write-InstallLog "Error clearing registry property: $($_.Exception.Message)" -Level Debug }
                foreach ($item in $Script:RegistryBackups[$Path].Data) {
                    Set-ItemProperty -Path $Path -Name $item.Name -Value $item.Value -Type $item.Type -Force -ErrorAction SilentlyContinue
                }
            }
            else {
                # Key didn't exist before, remove it if it exists now
                if (Test-Path $Path) {
                    Write-InstallLog "Removing registry key that didn't exist before: $Path" -Level Debug
                    Remove-Item $Path -Force -ErrorAction SilentlyContinue
                }
            }
        }
    }
    catch {
        Write-InstallLog "Failed to restore registry key $Path : $($_.Exception.Message)" -Level Debug
    }
}
# ============================================================================
# WINDOW EFFECTS (ACRYLIC / BLUR)
# ============================================================================
$Script:WindowEffectsCode = @"
using System;
using System.Runtime.InteropServices;
public class WindowEffects
{
    [StructLayout(LayoutKind.Sequential)]
    internal struct WindowCompositionAttributeData
    {
        public WindowCompositionAttribute Attribute;
        public IntPtr Data;
        public int SizeOfData;
    }
    internal enum WindowCompositionAttribute
    {
        WCA_ACCENT_POLICY = 19
    }
    internal enum AccentState
    {
        ACCENT_DISABLED = 0,
        ACCENT_ENABLE_GRADIENT = 1,
        ACCENT_ENABLE_TRANSPARENTGRADIENT = 2,
        ACCENT_ENABLE_BLURBEHIND = 3,
        ACCENT_ENABLE_ACRYLICBLURBEHIND = 4,
        ACCENT_INVALID_STATE = 5
    }
    [StructLayout(LayoutKind.Sequential)]
    internal struct AccentPolicy
    {
        public AccentState AccentState;
        public int AccentFlags;
        public int GradientColor;
        public int AnimationId;
    }
    [DllImport("user32.dll")]
    internal static extern int SetWindowCompositionAttribute(IntPtr hwnd, ref WindowCompositionAttributeData data);
    public static void EnableBlur(IntPtr hwnd, uint blurOpacity = 0, uint blurColor = 0x000000)
    {
        var accent = new AccentPolicy();
        // Use standard Blur (3) for maximum reliability across Win10/11 versions
        accent.AccentState = AccentState.ACCENT_ENABLE_BLURBEHIND;
        accent.GradientColor = 0; // Not needed for standard blur
        var accentStructSize = Marshal.SizeOf(accent);
        var accentPtr = Marshal.AllocHGlobal(accentStructSize);
        Marshal.StructureToPtr(accent, accentPtr, false);
        var data = new WindowCompositionAttributeData();
        data.Attribute = WindowCompositionAttribute.WCA_ACCENT_POLICY;
        data.SizeOfData = accentStructSize;
        data.Data = accentPtr;
        try
        {
            SetWindowCompositionAttribute(hwnd, ref data);
        }
        finally
        {
            Marshal.FreeHGlobal(accentPtr);
        }
    }
    [DllImport("user32.dll", CharSet = CharSet.Auto)]
    internal static extern IntPtr SendMessage(IntPtr hWnd, uint Msg, IntPtr wParam, IntPtr lParam);
    [DllImport("shell32.dll", SetLastError = true)]
    internal static extern void SetCurrentProcessExplicitAppUserModelID([MarshalAs(UnmanagedType.LPWStr)] string AppID);
    private const uint WM_SETICON = 0x0080;
    private const int ICON_SMALL = 0;
    private const int ICON_BIG = 1;
    public static void SetIcon(IntPtr hwnd, IntPtr hIconSmall, IntPtr hIconBig)
    {
        try
        {
             if (hIconSmall != IntPtr.Zero) SendMessage(hwnd, WM_SETICON, (IntPtr)ICON_SMALL, hIconSmall);
             if (hIconBig != IntPtr.Zero) SendMessage(hwnd, WM_SETICON, (IntPtr)ICON_BIG, hIconBig);
        }
        catch {}
    }
    public static void SetAUMID(string aumid)
    {
        try { SetCurrentProcessExplicitAppUserModelID(aumid); } catch {}
    }
}
"@
try { Add-Type -TypeDefinition $Script:WindowEffectsCode -Language CSharp } catch { Write-Warning "Failed to load WindowEffects type: $($_.Exception.Message)"; Write-Warning "Inner Exception: $($_.Exception.InnerException.Message)" }
# Prevent multiple instances (with Force option to clear stuck mutex)
$Script:MutexName = 'Global\M365UltimateInstaller'
$ScriptMutex = $null
if ($Force) {
    # Force mode: try to clear any stuck mutex
    try {
        $tempMutex = [System.Threading.Mutex]::OpenExisting($Script:MutexName)
        $tempMutex.Dispose()
    }
    catch {
        # Mutex doesn't exist or already disposed - expected behavior, suppress error
        $null = $_
    }
}
$ScriptMutex = New-Object System.Threading.Mutex($false, $Script:MutexName)
if (-not $ScriptMutex.WaitOne(0, $false)) {
    Add-Type -AssemblyName PresentationFramework
    [System.Windows.MessageBox]::Show(
        "Another instance of the installer is already running.`n`nPlease close the existing window before starting a new one.`n`nIf this persists after a restart, run the script with the -Force parameter.",
        'Microsoft 365 Ultimate Installer',
        [System.Windows.MessageBoxButton]::OK,
        [System.Windows.MessageBoxImage]::Warning
    )
    $ScriptMutex.Dispose()
    exit 1
}
