function Get-SystemInfo {
    try {
        $os = Get-CimInstance Win32_OperatingSystem -ErrorAction SilentlyContinue
        $cs = Get-CimInstance Win32_ComputerSystem -ErrorAction SilentlyContinue
        $cpu = Get-CimInstance Win32_Processor -ErrorAction SilentlyContinue
        $bio = Get-CimInstance Win32_BIOS -ErrorAction SilentlyContinue
        $diag = @"
--- SYSTEM DIAGNOSTICS ---
OS: $($os.Caption) ($($os.Version))
Build: $($os.BuildNumber)
Arch: $($os.OSArchitecture)
RAM: $([math]::Round($cs.TotalPhysicalMemory / 1GB, 2)) GB
CPU: $($cpu.Name)
MB: $($cs.Model) (Manufacturer: $($cs.Manufacturer))
BIOS: $($bio.SMBIOSBIOSVersion)
User: $env:USERNAME (Elevated: $([bool]([Security.Principal.WindowsPrincipal][Security.Principal.WindowsIdentity]::GetCurrent()).IsInRole([Security.Principal.WindowsBuiltInRole]::Administrator)))
Time: $(Get-Date -Format 'yyyy-MM-dd HH:mm:ss')
--------------------------
"@
        return $diag
    }
    catch {
        return "System Info Collection Failed: $($_.Exception.Message)"
    }
}
