        <Setter Property="IsTabStop" Value="false"/>
        <Setter Property="Focusable" Value="false"/>
        <Setter Property="ClickMode" Value="Press"/>
        <Setter Property="Template">
            <Setter.Value>
                <ControlTemplate TargetType="ToggleButton">
                    <Border x:Name="templateRoot" Background="{TemplateBinding Background}" BorderBrush="{TemplateBinding BorderBrush}" BorderThickness="{TemplateBinding BorderThickness}" SnapsToDevicePixels="true">
                        <Grid>
                            <Grid.ColumnDefinitions>
                                <ColumnDefinition Width="*"/>
                                <ColumnDefinition MinWidth="20" Width="0"/>
                            </Grid.ColumnDefinitions>
                            <Path x:Name="arrow" Grid.Column="1" Fill="White" HorizontalAlignment="Center" VerticalAlignment="Center" Data="F1 M 0,0 L 2.667,2.66665 L 5.3334,0 L 5.3334,-1.78168 L 2.6667,0.88501 L0,-1.78168 L0,0 Z" Margin="0,0,10,0"/>
                        </Grid>
                    </Border>
                    <ControlTemplate.Triggers>
                         <Trigger Property="IsMouseOver" Value="true">
                            <Setter TargetName="templateRoot" Property="Background" Value="#444444"/>
                        </Trigger>
                    </ControlTemplate.Triggers>
                </ControlTemplate>
            </Setter.Value>
        </Setter>
    </Style>
    <!-- ComboBox Style -->
    <Style TargetType="ComboBox">
        <Setter Property="Foreground" Value="White"/>
        <Setter Property="Background" Value="#111111"/>
        <Setter Property="BorderBrush" Value="#444444"/>
        <Setter Property="BorderThickness" Value="1"/>
        <Setter Property="ScrollViewer.HorizontalScrollBarVisibility" Value="Auto"/>
        <Setter Property="ScrollViewer.VerticalScrollBarVisibility" Value="Auto"/>
        <Setter Property="Padding" Value="6,3,5,3"/>
        <Setter Property="ScrollViewer.CanContentScroll" Value="true"/>
        <Setter Property="Template">
            <Setter.Value>
                <ControlTemplate TargetType="ComboBox">
                    <Grid x:Name="templateRoot" SnapsToDevicePixels="true">
                        <Grid.ColumnDefinitions>
                            <ColumnDefinition Width="*"/>
                            <ColumnDefinition MinWidth="20" Width="0"/>
                        </Grid.ColumnDefinitions>
                        <Popup x:Name="PART_Popup" AllowsTransparency="true" Grid.ColumnSpan="2" IsOpen="{Binding IsDropDownOpen, Mode=TwoWay, RelativeSource={RelativeSource TemplatedParent}}" Margin="1" Placement="Bottom" PopupAnimation="{DynamicResource {x:Static SystemParameters.ComboBoxPopupAnimationKey}}">
                            <Border x:Name="dropDownBorder" Background="#111111" BorderBrush="{TemplateBinding BorderBrush}" BorderThickness="1" MaxHeight="{TemplateBinding MaxDropDownHeight}" MinWidth="{Binding ActualWidth, ElementName=templateRoot}">
                                <ScrollViewer x:Name="DropDownScrollViewer">
                                    <Grid x:Name="grid" RenderOptions.ClearTypeHint="Enabled">
                                        <Canvas x:Name="canvas" HorizontalAlignment="Left" Height="0" VerticalAlignment="Top" Width="0">
                                            <Rectangle x:Name="opaqueRect" Fill="{Binding Background, ElementName=dropDownBorder}" Height="{Binding ActualHeight, ElementName=dropDownBorder}" Width="{Binding ActualWidth, ElementName=dropDownBorder}"/>
                                        </Canvas>
                                        <ItemsPresenter x:Name="ItemsPresenter" KeyboardNavigation.DirectionalNavigation="Contained" SnapsToDevicePixels="{TemplateBinding SnapsToDevicePixels}"/>
                                    </Grid>
                                </ScrollViewer>
                            </Border>
                        </Popup>
                        <ToggleButton x:Name="toggleButton" Background="{TemplateBinding Background}" BorderBrush="{TemplateBinding BorderBrush}" BorderThickness="{TemplateBinding BorderThickness}" Grid.ColumnSpan="2" IsChecked="{Binding IsDropDownOpen, Mode=TwoWay, RelativeSource={RelativeSource TemplatedParent}}" Style="{StaticResource ComboBoxToggleButton}"/>
                        <ContentPresenter x:Name="contentPresenter" ContentStringFormat="{TemplateBinding SelectionBoxItemStringFormat}" ContentTemplate="{TemplateBinding SelectionBoxItemTemplate}" Content="{TemplateBinding SelectionBoxItem}" ContentTemplateSelector="{TemplateBinding ItemTemplateSelector}" HorizontalAlignment="{TemplateBinding HorizontalContentAlignment}" IsHitTestVisible="false" Margin="{TemplateBinding Padding}" SnapsToDevicePixels="{TemplateBinding SnapsToDevicePixels}" VerticalAlignment="{TemplateBinding VerticalContentAlignment}"/>
                    </Grid>
                </ControlTemplate>
            </Setter.Value>
        </Setter>
    </Style>
    <Style TargetType="ComboBoxItem">
        <Setter Property="Background" Value="#333333"/>
        <Setter Property="Foreground" Value="White"/>
        <Setter Property="BorderThickness" Value="0"/>
        <Setter Property="Padding" Value="10,5"/>
        <Setter Property="Template">
            <Setter.Value>
                <ControlTemplate TargetType="ComboBoxItem">
                     <Border x:Name="Bd" Background="{TemplateBinding Background}" BorderBrush="{TemplateBinding BorderBrush}" BorderThickness="{TemplateBinding BorderThickness}" Padding="{TemplateBinding Padding}" SnapsToDevicePixels="true">
                        <ContentPresenter HorizontalAlignment="{TemplateBinding HorizontalContentAlignment}" VerticalAlignment="{TemplateBinding VerticalContentAlignment}" SnapsToDevicePixels="{TemplateBinding SnapsToDevicePixels}"/>
                    </Border>
                    <ControlTemplate.Triggers>
                        <Trigger Property="IsHighlighted" Value="true">
                            <Setter TargetName="Bd" Property="Background" Value="#555555"/>
                        </Trigger>
                        <Trigger Property="IsSelected" Value="true">
                             <Setter TargetName="Bd" Property="Background" Value="{StaticResource Brush.Accent1}"/>
                        </Trigger>
                    </ControlTemplate.Triggers>
                </ControlTemplate>
            </Setter.Value>
        </Setter>
    </Style>
    <Style TargetType="Button" x:Key="Style.Button.Primary">
<Setter Property="Background" Value="{StaticResource Brush.Accent.Gradient}"/>
<Setter Property="Foreground" Value="White"/>
<Setter Property="BorderThickness" Value="0"/>
<Setter Property="FontSize" Value="14"/>
<Setter Property="FontWeight" Value="SemiBold"/>
<Setter Property="Cursor" Value="Hand"/>
<Setter Property="Template">
<Setter.Value>
<ControlTemplate TargetType="Button">
<Border x:Name="border" Background="{TemplateBinding Background}" CornerRadius="6" SnapsToDevicePixels="True">
<ContentPresenter HorizontalAlignment="Center" VerticalAlignment="Center" Margin="15,8"/>
</Border>
<ControlTemplate.Triggers>
<Trigger Property="IsMouseOver" Value="True">
<Setter TargetName="border" Property="Opacity" Value="0.9"/>
</Trigger>
<Trigger Property="IsPressed" Value="True">
<Setter TargetName="border" Property="Opacity" Value="0.7"/>
</Trigger>
</ControlTemplate.Triggers>
</ControlTemplate>
</Setter.Value>
</Setter>
</Style>
<Style TargetType="Button" x:Key="Style.Button.Secondary">
<Setter Property="Background" Value="#333333"/>
<Setter Property="Foreground" Value="White"/>
<Setter Property="BorderThickness" Value="1"/>
<Setter Property="BorderBrush" Value="#555555"/>
<Setter Property="Template">
<Setter.Value>
<ControlTemplate TargetType="Button">
<Border x:Name="border" Background="{TemplateBinding Background}" BorderBrush="{TemplateBinding BorderBrush}" BorderThickness="{TemplateBinding BorderThickness}" CornerRadius="6">
<ContentPresenter HorizontalAlignment="Center" VerticalAlignment="Center" Margin="15,8"/>
</Border>
<ControlTemplate.Triggers>
<Trigger Property="IsMouseOver" Value="True">
<Setter TargetName="border" Property="Background" Value="#444444"/>
</Trigger>
</ControlTemplate.Triggers>
</ControlTemplate>
</Setter.Value>
</Setter>
</Style>
<Style TargetType="Button" x:Key="Style.Button.WindowControl">
<Setter Property="Background" Value="Transparent"/>
<Setter Property="Foreground" Value="#AAAAAA"/>
<Setter Property="WindowChrome.IsHitTestVisibleInChrome" Value="True"/>
<Setter Property="Template">
<Setter.Value>
<ControlTemplate TargetType="Button">
<Border x:Name="border" Background="{TemplateBinding Background}" CornerRadius="0">
<ContentPresenter HorizontalAlignment="Center" VerticalAlignment="Center"/>
</Border>
<ControlTemplate.Triggers>
<Trigger Property="IsMouseOver" Value="True">
<Setter TargetName="border" Property="Background" Value="#33FFFFFF"/>
<Setter Property="Foreground" Value="White"/>
</Trigger>
</ControlTemplate.Triggers>
</ControlTemplate>
</Setter.Value>
</Setter>
</Style>
<Style TargetType="Button" x:Key="Style.Button.Close" BasedOn="{StaticResource Style.Button.WindowControl}">
<Style.Triggers>
<Trigger Property="IsMouseOver" Value="True">
<Setter Property="Background" Value="#E81123"/>
</Trigger>
</Style.Triggers>
</Style>
<!-- Card Style Checkbox -->
<Style TargetType="CheckBox" x:Key="Style.CheckBox.Card">
<Setter Property="Foreground" Value="White"/>
<Setter Property="Cursor" Value="Hand"/>
<Setter Property="Height" Value="45"/>
<Setter Property="Margin" Value="4"/>
<Setter Property="Template">
<Setter.Value>
<ControlTemplate TargetType="CheckBox">
<Border x:Name="border" Background="#2A2A2A" BorderBrush="#3A3A3A" BorderThickness="1" CornerRadius="6">
<Grid Margin="10,0">
<Grid.ColumnDefinitions>
<ColumnDefinition Width="Auto"/>
<ColumnDefinition Width="*"/>
</Grid.ColumnDefinitions>
<Border x:Name="checkmarkBox" Width="20" Height="20" CornerRadius="4" BorderBrush="#666666" BorderThickness="1" Background="Transparent" VerticalAlignment="Center">
<Path x:Name="checkPath" Data="M2,10 L7,15 L18,4" Stroke="White" StrokeThickness="2" Visibility="Collapsed" HorizontalAlignment="Center" VerticalAlignment="Center"/>
</Border>
<ContentPresenter Grid.Column="1" HorizontalAlignment="Left" VerticalAlignment="Center" Margin="10,0,0,0"/>
</Grid>
</Border>
<ControlTemplate.Triggers>
<Trigger Property="IsMouseOver" Value="True">
<Setter TargetName="border" Property="Background" Value="#353535"/>
<Setter TargetName="border" Property="BorderBrush" Value="#555555"/>
</Trigger>
<Trigger Property="IsChecked" Value="True">
<Setter TargetName="border" Property="Background" Value="#200078D4"/>
<Setter TargetName="border" Property="BorderBrush" Value="{StaticResource Brush.Accent1}"/>
<Setter TargetName="checkmarkBox" Property="Background" Value="{StaticResource Brush.Accent1}"/>
<Setter TargetName="checkmarkBox" Property="BorderBrush" Value="{StaticResource Brush.Accent1}"/>
<Setter TargetName="checkPath" Property="Visibility" Value="Visible"/>
</Trigger>
</ControlTemplate.Triggers>
</ControlTemplate>
</Setter.Value>
</Setter>
</Style>
<!-- Mode Radio Button (Card) -->
<Style TargetType="RadioButton" x:Key="Style.RadioButton.Mode">
<Setter Property="Template">
<Setter.Value>
<ControlTemplate TargetType="RadioButton">
<Border x:Name="border" Background="#252525" BorderBrush="#444444" BorderThickness="1" CornerRadius="8" Padding="20" Margin="10" Cursor="Hand">
<StackPanel>
<TextBlock Text="{TemplateBinding Tag}" FontSize="18" FontWeight="Bold" Foreground="White" Margin="0,0,0,10"/>
<ContentPresenter/>
</StackPanel>
</Border>
<ControlTemplate.Triggers>
<Trigger Property="IsChecked" Value="True">
<Setter TargetName="border" Property="BorderBrush" Value="{StaticResource Brush.Accent1}"/>
<Setter TargetName="border" Property="BorderThickness" Value="2"/>
<Setter TargetName="border" Property="Background" Value="#150078D4"/>
</Trigger>
<Trigger Property="IsMouseOver" Value="True">
<Setter TargetName="border" Property="Background" Value="#303030"/>
</Trigger>
</ControlTemplate.Triggers>
</ControlTemplate>
</Setter.Value>
</Setter>
</Style>
<ControlTemplate x:Key="ScrollViewerModern" TargetType="ScrollViewer">
<Grid x:Name="Grid" Background="{TemplateBinding Background}">
<Grid.ColumnDefinitions>
<ColumnDefinition Width="*"/>
<ColumnDefinition Width="Auto"/>
</Grid.ColumnDefinitions>
<Grid.RowDefinitions>
<RowDefinition Height="*"/>
<RowDefinition Height="Auto"/>
</Grid.RowDefinitions>
<ScrollContentPresenter x:Name="PART_ScrollContentPresenter" CanContentScroll="{TemplateBinding CanContentScroll}" CanHorizontallyScroll="False" CanVerticallyScroll="False" ContentTemplate="{TemplateBinding ContentTemplate}" Content="{TemplateBinding Content}" Grid.Column="0" Margin="{TemplateBinding Padding}" Grid.Row="0"/>
<ScrollBar x:Name="PART_VerticalScrollBar" AutomationProperties.AutomationId="VerticalScrollBar" Cursor="Arrow" Grid.Column="1" Maximum="{TemplateBinding ScrollableHeight}" Minimum="0" Grid.Row="0" Visibility="{TemplateBinding ComputedVerticalScrollBarVisibility}" Value="{Binding VerticalOffset, Mode=OneWay, RelativeSource={RelativeSource TemplatedParent}}" ViewportSize="{TemplateBinding ViewportHeight}" Width="10"/>
</Grid>
</ControlTemplate>
</Window.Resources>
<!-- MAIN CONTAINER WITH BLUR BACKGROUND -->
<Border x:Name="MainBorder" Background="{StaticResource Brush.Background}" CornerRadius="10" BorderBrush="#444444" BorderThickness="1" ClipToBounds="True">
<Grid>
<Grid.RowDefinitions>
<RowDefinition Height="Auto"/> <!-- Title Bar -->
<RowDefinition Height="*"/>    <!-- Content -->
<RowDefinition Height="Auto"/> <!-- Footer -->
</Grid.RowDefinitions>
<!-- TITLE BAR -->
<Grid x:Name="TitleBar" Grid.Row="0" Height="40" Background="Transparent">
<Grid.ColumnDefinitions>
<ColumnDefinition Width="Auto"/> <!-- Logo -->
<ColumnDefinition Width="*"/>    <!-- Title -->
<ColumnDefinition Width="Auto"/> <!-- Controls -->
</Grid.ColumnDefinitions>
<StackPanel Orientation="Horizontal" Grid.Column="0" Margin="15,0,0,0" VerticalAlignment="Center">
<Image x:Name="imgTitleLogo" Height="24" Margin="0,0,10,0"/>
<TextBlock Text="Microsoft Ultimate Installer" Foreground="#CCCCCC" VerticalAlignment="Center" FontSize="12"/>
</StackPanel>
<StackPanel Grid.Column="2" Orientation="Horizontal">
<Button x:Name="btnMinimize" Content="__" Width="46" Height="40" Style="{StaticResource Style.Button.WindowControl}" Padding="0,0,0,8"/>
<Button x:Name="btnMaximize" Content="[ ]" Width="46" Height="40" Style="{StaticResource Style.Button.WindowControl}" FontSize="12" Visibility="Collapsed"/>
<Button x:Name="btnClose" Content="X" Width="46" Height="40" Style="{StaticResource Style.Button.Close}" FontSize="14"/>
</StackPanel>
</Grid>
<!-- PAGES CONTAINER -->
<Grid Grid.Row="1" Margin="20,10,20,10">
            <!-- Page: Mode Selection (Overview) -->
            <Grid x:Name="PageMode" Visibility="Visible">
                <StackPanel VerticalAlignment="Center" HorizontalAlignment="Center" Width="600">
                    <!-- HERO LOGO -->
                    <Image x:Name="imgMainLogo" Height="100" Margin="0,0,0,10" HorizontalAlignment="Center" Stretch="Uniform"/>
                    <TextBlock Text="Microsoft Ultimate Installer" FontSize="24" FontWeight="SemiBold" Foreground="White" HorizontalAlignment="Center" Margin="0,0,0,30" Opacity="0.9"/>
                    <!-- ACTIONS -->
                    <StackPanel Margin="0,10,0,0">
                         <!-- Express -->
                         <RadioButton x:Name="rbExpress" Tag="Express Mode" GroupName="Mode" IsChecked="True" Style="{StaticResource Style.RadioButton.Mode}" Padding="15" Margin="0,0,0,10">
                            <Grid>
                                <Grid.ColumnDefinitions>
                                    <ColumnDefinition Width="Auto"/>
                                    <ColumnDefinition Width="*"/>
                                </Grid.ColumnDefinitions>
                                <StackPanel Grid.Column="1" Margin="10,0,0,0">
                                    <TextBlock Text="⚡ Quick Setup (Recommended)" FontSize="16" FontWeight="Bold" Foreground="White" Margin="0,0,0,5"/>
                                    <TextBlock Text="Automatically installs Microsoft 365 Enterprise with all essential apps: Word, Excel, PowerPoint, Outlook, Teams, OneDrive, and more. Includes activation and desktop shortcuts." Foreground="#AAAAAA" TextWrapping="Wrap"/>
                                </StackPanel>
                            </Grid>
                         </RadioButton>
                         <!-- Custom -->
                         <RadioButton x:Name="rbCustom" Tag="Custom Mode" GroupName="Mode" Style="{StaticResource Style.RadioButton.Mode}" Padding="15" Margin="0,0,0,10">
                            <Grid>
                                <Grid.ColumnDefinitions>
                                    <ColumnDefinition Width="Auto"/>
                                    <ColumnDefinition Width="*"/>
                                </Grid.ColumnDefinitions>
                                <StackPanel Grid.Column="1" Margin="10,0,0,0">
                                     <TextBlock Text="🎛️ Advanced Configuration" FontSize="16" FontWeight="Bold" Foreground="White" Margin="0,0,0,5"/>
                                     <TextBlock Text="Customize your installation: select specific apps (Word, Excel, etc.), exclude components, and install additional tools like PowerToys and VS Code." Foreground="#AAAAAA" TextWrapping="Wrap"/>
                                </StackPanel>
                            </Grid>
                         </RadioButton>
                         <!-- Uninstall -->
                         <RadioButton x:Name="rbUninstall" Tag="Uninstall Mode" GroupName="Mode" Style="{StaticResource Style.RadioButton.Mode}" Padding="15" Margin="0,0,0,10">
                            <Grid>
                                <Grid.ColumnDefinitions>
                                    <ColumnDefinition Width="Auto"/>
                                    <ColumnDefinition Width="*"/>
                                </Grid.ColumnDefinitions>
                                <StackPanel Grid.Column="1" Margin="10,0,0,0">
                                    <TextBlock Text="🧹 Complete Removal" FontSize="16" FontWeight="Bold" Foreground="White" Margin="0,0,0,5"/>
                                    <TextBlock Text="Fully removes Microsoft Office and related apps. Cleans registry entries, temporary files, and licensing data. Use this to fix installation issues or before a fresh install." Foreground="#AAAAAA" TextWrapping="Wrap"/>
                                </StackPanel>
                            </Grid>
                         </RadioButton>
                    </StackPanel>
                    <Button x:Name="btnModeNext" Content="▶  Begin Setup" Width="300" Height="45" Margin="0,30,0,0" Style="{StaticResource Style.Button.Primary}" FontSize="16"/>
                </StackPanel>
            </Grid>
