function Test-File {
    param(
        [Parameter(Mandatory)][string]$Path,
        [string]$Label = 'File'
    )
    if (-not (Test-Path $Path)) {
        throw "$Label not found at: $Path"
    }
    Write-InstallLog "$Label validated: $Path" -Level Debug
}
